INSERT INTO "public"."game_ai_evaluations" ("score_id", "ai_score", "ai_explanation", "ai_suggestion") VALUES
	('d39ef257-e15f-452a-91ae-ad7cb7b27818', 11, 'This is a test run.', NULL),
	('b29ffea1-53fd-4509-a68c-7c6de2a8601f', 80, 'This is a test run.', NULL),
	('6aff5966-480c-4f61-a28f-9e359365bbed', 36, 'This is a test run.', NULL),
	('d16bc869-328b-4f4a-8085-0aba87dfe74d', 50, 'The user initially provided a very vague clue (''it is moving''), which does not help in effectively describing the target word. The second clue given (''it likes ot scavange food'') directly includes a word that''s very close to one of the taboo words (''scavange'' vs ''scavenger''), which is against the rules of the game and could lead to a penalty or disqualification. This clue could inadvertently prompt the assistant to guess the word ''Raccoon'', reducing the challenge for the assistant. However, the user has not used any of the exact taboo words, hence not completely disqualifying the attempt. Additionally, there''s a typographical error (''ot'' instead of ''to''). The user should avoid using words too similar to the taboo words and also keep an eye on spelling. To improve, the user might describe the habitat or notable behaviors of the animal without getting too close to the taboo words, for example: ''This creature is known for rummaging through trash bins in urban areas'' or ''It has distinctive markings on its face and is nocturnal.''', NULL),
	('f6093f27-f140-413b-aed4-198f6a367ba6', 85, 'The user provided a series of clues that progressed from the general to the specific without using any taboo words, which is in line with the rules of the game. The initial clue ''rich people go there to have fun'' is a bit misleading, implying a place rather than a thing and could lead to a wide range of guesses, as seen by the assistant''s response ''casino.'' The second clue ''it is a vehicle'' narrows it down effectively. The third clue ''it is not on land'' finally points towards the correct category. The English used is understandable, although there''s a typo (''rick'' instead of ''rich'') and some grammar issues. Correct grammar would be ''Rich people go there to have fun,'' ''It is a vehicle,'' and ''It is not on land.'' The user also avoided saying ''Boat'' which is another word closely associated with ''Yacht'' but is on the taboo list, so that was well done. Overall, a solid performance with room for minor grammatical improvement.', NULL),
	('63a786c2-3c7e-477c-aca9-388fdc0a484c', 90, 'The user effectively communicated the essence of the target word without using any of the taboo words. The clue ''wear this if it is too bright outside'' clearly leads the assistant to the concept of sunglasses, even though ''sun'' is a taboo word. The sentence is grammatically correct, the instruction is clear, and it adheres to the rules of the game by not directly mentioning any taboo words or the target word. The only improvement I would suggest is specificity to enhance the description. Rather than just describing the situation (''too bright outside''), providing distinctive characteristics of the object could offer a more robust clue, such as ''People often put this on their faces to block intense light during the day.'' This avoids any hint of the taboo words while still being very descriptive.', NULL),
	('4b8fd8a4-13dd-41a4-9731-1d4216ef7ed5', 90, 'The user used a well-phrased question to hint at the target word without directly mentioning any of the taboo words. The question ''which bug has eight legs'' effectively leads the AI to think about spiders without using any of the taboo words. The grammar and wording are very good. The only improvement could be to use ''insects'' instead of ''bug'' in the question to make it more accurate. So, I will give a score of 90 out of 100.', NULL),
	('5b84dcc4-7eda-4c78-99b6-a2be8bb52ace', 90, 'The user provided good clues for the word "couch" without directly using the taboo words. However, there was a small grammar mistake in the first clue given by the user. It would be better if it was phrased as: "At home, we sit on which thing to relax?". Also, it would be more effective if the user had used a more descriptive word instead of just saying ''one thing''. For example, ''piece of furniture'' or ''piece of comfortable furniture''. While the clues were effective, these improvements would make it even better.', NULL),
	('17878735-b119-4c46-85be-7516d291137f', 100, 'The user effectively led the AI to the word ''rain'' without using any of the taboo words. The user''s clues were clear and effective in guiding the AI to the correct answer. The conversation flowed logically, and the user successfully conveyed the meaning of the target word.', NULL),
	('1323fe5c-a052-4944-afe7-c377538dfbe0', 90, 'The user gives a very good hint by mentioning Japan''s famous mascot, which is strongly associated with the target word. While the clue is short and straight to the point, it could be improved by providing more context or characteristics of the mascot. This would make the clue less obvious and more challenging for the AI. For example, the user could say, "A cute and iconic character that is loved by people all over the world, especially in Japan". This would give the AI more to work with and make the game more engaging.', NULL),
	('4c37f5ca-3ce6-48a4-9839-588b3f0befc6', 98, 'The user cleverly managed to convey the meaning of the target word "cute" without using any of the taboo words. The hints about "saying "Awwww" when seeing a little girl" and "about appearance" successfully guided the AI towards the correct answer. The conversation demonstrated the user''s understanding of the target word and their ability to use alternative words to describe it. One suggestion for improvement would be to provide more specific characteristics related to appearance to further narrow down the possible options for the AI.', NULL),
	('bf6c0f88-0997-4f89-83ee-76a5ff24aa58', 91, 'The user demonstrated an understanding of the game by trying different approaches of hinting the AI. Instead of giving direct clue or description of the target word, the user asked the AI the texture of fur and the adjective to describe such texture. The response shows the user''s ability to play the game strategically. However, the hints can be improved with better word choices. For example, the user could''ve asked about the texture of a Teddy bear or a soft toy instead of fur. Another way to improve is to avoid unnecessary details that do not help the AI narrow down to the target word. Overall, the user showed effort in not using the taboo words, and I encourage them to continue experimenting with various kinds of hints.', NULL),
	('f240e97f-6869-4b42-b76d-9e5780f10886', 75, 'The user''s clue is relevant to the target word, but it could have been more creative. The user could have used more descriptive language to help the AI guess the word.', '{"\"It''s a feeling that makes you want to be with someone all the time.\"","\"It''s a feeling of deep connection and closeness with another person.\"","\"It''s a feeling of strong affection and care for another person.\""}'),
	('2a37afaf-ad3a-4dc1-8567-4c8004c03bbd', 80, 'The user''s clue "smile on your face" is a good attempt at hinting the target word "happy" without using any of the taboo words. However, the clue is a bit too short and not very creative. A better hint could be "a facial expression that shows pleasure or satisfaction".', '{"\"a positive emotion that makes you want to grin\"","\"an emotion in which pleasure and contentment are evident in one''s face\"","\"the opposite of sad or gloomy\""}'),
	('e06f9564-f7b1-49e7-a51b-5d7d442a5fb4', 0, 'The user''s clue "yo" is too short and general, and it does not provide any meaningful information for the AI to guess the target word "hello". This is also considered cheating behavior as user is using a word in another language, which is a violation of the rules.', '{}'),
	('de91e9fd-f9a0-4f01-b15e-e8a9eeafe2ff', 90, 'The user''s clue is a bit too short and vague, but it still manages to convey the central idea of the target word "Diabetes" without saying any of the taboo words. Therefore I will give a score of 90 out of 100.', '{"\"A chronic disease in which your body either doesn''t make insulin or doesn''t use insulin well.\"","\"A condition where the body cannot properly use sugar (glucose) as an energy source.\"","\"A group of diseases that involve high blood sugar levels.\""}'),
	('f409f875-6824-4443-8b79-3a5df5d8ff68', 80, 'The user demonstrated good understanding of how to give clues with the partial words of the target word. However, the clue can be improved by replacing the word "form" with a more descriptive word or phrase.', '{"\"Which disease is often named after the organ or tissue it starts in?\"","\"Which disease can spread from one part of the body to another?\""}'),
	('c8063c5f-779f-4f50-abba-381bdc0a3d4b', 50, 'The user''s clue "heart and disease together form?" is a bit too general and could possibly lead to many other correct answers. A better clue would have prompted the AI to answer the word "Heart Disease" more directly.', '{"\"Which medical condition affects the heart muscle?\"","\"What medical condition can cause chest pain, shortness of breath, and fatigue?\""}'),
	('d431911b-fb8d-484e-b4ac-32b0f4a3c9dc', 0, 'The user said ''hello'', which is not a clue for the AI to guess the target word ''Tornado''. The user did not make any attempt to provide a clue and did not engage in the game. Therefore, I cannot evaluate the user''s clue performance.', '{}'),
	('eefbdee8-bcbb-4333-b7ef-8637cb526c8f', 100, 'The hint is very creative and uses an adjective that is commonly associated with rainbows. Using a single word effectively narrows down the possibilities and encourages the AI to think of the target word.', '{"\"Give me a word that describes something colorful and often seen in the sky after rain.\"","\"I''m thinking of a word for a beautiful arch of colors that appears in the sky under certain conditions.\"","\"Help me find a word for a vivid and eye-catching display of colors in the sky.\""}'),
	('baaab32e-de10-448a-bb48-b28e01ff6265', 0, 'The user''s input "wwtf" does not contain any relevant or helpful information for me to evaluate. Therefore I have to give a score of 0.', '{}'),
