INSERT INTO "public"."plan_features" ("id", "plan_id", "title", "description", "status") VALUES
	('95bb03b5-8992-42cc-976d-375573deff4b', '5754a6c1-52cd-4e2f-8e5c-f787fca19051', 'Unlimited access to public topics', 'In "Choose A Topic" page, you will be able to access all public topics available.', 'complete'),
	('5d09e2a1-2831-4015-919f-092aba78f5d7', '5754a6c1-52cd-4e2f-8e5c-f787fca19051', 'Basic AI Evaluation', 'After completing a game, your performance will be evaluated by Taboo AI. AI evaluation serves as a great way to improve your English skills by pointing out your grammatical mistakes and suggesting improvements. The free plan offers basic AI evaluation, delivering valuable albeit less accurate feedback.', 'partial'),
	('5cbbf7bc-e4e8-45d2-8aa5-268f7f7513d7', '5754a6c1-52cd-4e2f-8e5c-f787fca19051', 'View 1 most recent game in profile', 'In your profile, you are able to see your most recent 1 game played. You can revisit the game results by clicking on the game card. PRO plan allows you to view most recent 10 game results.', 'partial'),
	('6a7492ac-1beb-4c6c-88fa-84c87ed1f537', '5754a6c1-52cd-4e2f-8e5c-f787fca19051', 'No access to AI Mode', 'In "Choose A Topic" page, if you cannot find the topics you are looking for, you can use "AI Mode", which will automatically generate a custom game of taboo based on the topic you entered.', 'absent'),
	('7caeb084-adf5-4acb-ab9b-9f5736e4271c', '5754a6c1-52cd-4e2f-8e5c-f787fca19051', 'No access to exclusive game statistics', 'In your profile, a game statistics section is available for PRO plan users. It provides you with insights on your performance, for example, how many recent-games you have played, which topic you have played the most,, which topic you have the best performance, etc.', 'absent'),
	('4ac5c2d8-2760-4690-82bb-3b77b2654ab7', '177f2ba2-d854-47b4-992e-dea1b20fd9f5', 'Unlimited access to public topics', 'In "Choose A Topic" page, you will be able to access all public topics available. However, you will not be able to access topics curated by Taboo AI, which are more organized and structured.', 'complete'),
	('69fa5ab1-108b-495a-978b-f681a41e6a1d', '177f2ba2-d854-47b4-992e-dea1b20fd9f5', 'Comprehensive AI evaluation', 'After playing a game, Taboo AI evaluates your performance, aiding in enhancing your English skills by highlighting grammatical errors and offering suggestions for improvement. The Pro plan employs our cutting-edge AI model. You will also unlock a new AI suggestion section where AI provides sample answers.', 'complete'),
	('a96928bc-4295-4d95-92e3-b77cc3a29ed4', '177f2ba2-d854-47b4-992e-dea1b20fd9f5', 'View 10 most recent games in profile', 'In your profile, you are able to see your most recent 10 recent-games played. You can revisit the game results by clicking on the game card.', 'complete'),
	('b1cef674-c4ea-4085-b07b-d69655c014db', '177f2ba2-d854-47b4-992e-dea1b20fd9f5', 'Access to AI Mode', 'In "Choose A Topic" page, if you cannot find the topics you are looking for, you can use "AI Mode", which will automatically generate a custom game of taboo based on the topic you entered.', 'complete'),
